import React from 'react'
import './ExpenseItem.css'
const ExpenseItem = (props) => {
  return (
    <div>
      <div>{props.date}</div>
      <div className=".expense-item__description">{props.title}</div>
      <div className=".expense-item__price">{props.price}</div>
    </div>
  );
}

export default ExpenseItem
